import React from "react";
import "../bulma/css/bulma.min.css";
import "../App.css";
import { useEffect } from "react";
import { useState } from "react";
import Convert from "convert-svg-react";
//import { SvgXml } from "react-native-svg";

const svgFile = `<svg width="1em" height="1em" viewBox="0 0 16 16" class="bi bi-caret-right-square-fill" fill="currentColor" xmlns="http://www.w3.org/2000/svg"> 
<path fill-rule="evenodd" d="M0 2a2 2 0 0 1 2-2h12a2 2 0 0 1 2 2v12a2 2 0 0 1-2 2H2a2 2 0 0 1-2-2V2zm5.5 10a.5.5 0 0 0 .832.374l4.5-4a.5.5 
0 0 0 0-.748l-4.5-4A.5.5 0 0 0 5.5 4v8z"/>
</svg>`;

function SVGConvert(props) {
  const [svg, setSvg] = useState("");

  useEffect(() => {
    // Returns a promise
    Convert(svgFile).then((svg) => setSvg(svg));
  }, []);

  return (
    <>
      {/* Will display your converted code for copying as well as your svg */}
      {svg && svg}
    </>
  );
}

function TrustedLeadingBrandsAPI() {
  const [data, setData] = useState([]);

  const apiGet = () => {
    fetch("http://127.0.0.1:5000/api_get_trusted_leading_brands")
      .then((respose) => respose.json())
      .then((json) => {
        console.log(json);
        setData(json);
      });
  };

  useEffect(() => {
    apiGet();
  }, []);

  return (
    <div>
      <div>
        MY API
        <br />
      </div>
      <div>
        {" "}
        <SVGConvert />
        <div>
          <Convert string={svgFile} />
        </div>
      </div>
      <div></div>
    </div>
  );
}

export default TrustedLeadingBrandsAPI;

